import React, { Component } from 'react';
import '../../Styles/DinoDoods.css';

import Fade from 'react-reveal/Fade';

class One extends Component {
    state = {  } 
    render() { 
        return (
            <div className='whole'>

                <Fade><div>
                <p id = "title">Overview</p>
                <p id = "subtitle" className='overviewPara'>Analyzed and developed website improvements for company’s audience and brand.
                </p>

                </div></Fade>


               <Fade top><div id = "problem">
                    <p id = "title" className='problemTitle'>Problem</p>
                    <p id = "paragraph">
                    The previous developer had a difficulty meeting our team’s goals and website requirements. Faulties of the website included: inconsistency of color pallete, website attraction did not meet audience standards, and UI/UX was not mobile friendly. No critics changed until after the departure of our former developer.
                    </p>
                </div>
                </Fade> 

               <Fade bottom><div id = "solution">
                    <p id = "title">Solution</p>
                    <p id = "paragraph">As an aspiring developer, I took the lead to be our new web developer and designer. New implementations were made to enhance the website to cater to our audience. </p>
                    <p id = "smallSubtitle">React | Figma | Procreate</p>
                </div></Fade> 

                <div className='stepsTowards'>
                    <p id = "title">Steps Towards Solution</p>
                </div>

            </div>



        );
    }
}

export default One;
